let randomData=function () {
    let brand=["苹果","小米","华为","三星","oppo"]
    let brandData=[]
//生成随机数据
    for(let i in brand){
        brandData.push({brandName:brand[i]})
        brand[i].headArr=[]
        for(let j in 12){
            brand[i].headArr[j].label=j+'月'
            brand[i].headArr[j].prop='month'+j
        }
    }
    return brandData
}
// brandData=randomData()
export default randomData
